import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

// import { library } from '@fontawesome/fontawesome-svg-core'; //fontawesomeのコアファイル
// import { fab } from '@fontawesome/free-brands-svg-icons'; //fontawesomeのbrandアイコンのインポート
// import { fas } from '@fontawesome/free-solid-svg-icons'; //fontawesomeのsolidアイコンのインポート
// import { far } from '@fontawesome/free-regular-svg-icons'; //fontawesomeのregularアイコンのインポート

library.add(fab, fas, far); //他のコンポーネントから簡単に呼び出せるようにするための登録処理？

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
